import React from "react";

function Login(props){
    return (
        <div>
            <h1>Login</h1>
            <input type="text" placeholder="Username" name="password"/>
            <input type="password" placeholder="Password" name="password"/>
            <button>Login</button>
        </div>
    )
}

export default Login;
